Defendant Mary L Molale in court with Attorney James E Toran.  Benjamin A Wesson appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
AS TO COUNT 3:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 2 YEARS, CONSECUTIVE to any other sentence with credit for 0 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 1 YEAR.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 1 YEAR.

The defendant IS NOT  eligible for the Challenge Incarceration Program or the Substance Abuse Program.  The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION:
*Obtain AODA assessment and if deemed necessary complete follow-up care/treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victims Nicholas F., Aaron R., Alexandre J.-S., Elizabeth L., Karissa H., Mitchell H., and co-actors Abigail Baez, Willmarvin Diaz-Boria, Jeriel Rodriguez, and Erik Tejada;
*Participate in Cognitive Thinking;
*Participate in Victim Impact class;
*Obtain/maintain full time employment or full time school with part time employment;
*Obtain high school diploma or GED or HSED;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

AS TO COUNT 4:  The Court ordered the defendant to serve 5 MONTHS in the House of Corrections with Huber release for employment, employment search, school, probation programming, with credit for 47 days time served.  NO ELECTRONIC MONITORING.  Sentence STAYED until 6-30-14.  Defendant to report to the HOC no later than 2:30 p.m.

AS TO BOTH COUNTS:
Defendant to pay all mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment.
State in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $75.00 payable to Aaron R- to be paid within the first year of probation period.  Any remaining balance to convert to civil judgment.  Restitution is joint and several with any co-actor ultimately convicted and sentenced in this matter (cases 14CF292-14CF296)  If revoked, the Court ordered all financial obligations (as to both counts) and restitution to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Defendant is informed she may not possess and/or own any firearms.  Defendant is informed she may not vote in any election until her civil rights have been reinstated.  Appeal rights given by the court.  The Court has no objection to expungement upon successful completion of ALL conditions of probation.
